import React, { Component } from 'react';
import Logo from '../Atoms/Logo';

class MainNavigation extends Component {
    constructor(props) {
        super(props);
        this.state = {  };
    }

    render() {
        var className = [
            styles.logo,
            this.props.className
        ].join(' ');
        return (
            <Logo size="medium"/>
        );
    }
}

export default MainNavigation;
